import React, { Component } from 'react';
import Header from './components/Header'
import Footer from './components/Footer'
import Home from './components/Home'
import List from './components/List'
import styles from './styles/main.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const Modal = () => {
  return (
    <div id="my-modal">
      <div className="card">
        <div id="close">X</div>
        <div className="profile-bg center">
          <img src="" id="avatar" /> 
        </div> 
        <div class="profile-info">
          <div class="review center"><span>&#9733;</span> 4.9</div>
          <h2 id="name" class="center"></h2>
          <div id="email" class="center"></div>
          <div id="address" class="center"></div>
          <p>
            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard
          </p>
        </div>
        <div class="profile-footer">

          <a class="btn-send" id="call-msg">Contact</a>
        </div>
      </div>
    </div>
  );
};



class App extends Component {



  render() {
    return (
      <Router>
        <div>
          <Header />
          <main className={styles['main']} >          
            <div className={styles['main-content']}>
              <Route exact path="/" component={Home} />  
              <Route exact path="/list" component={List} />          
            </div>
          </main>
          <Modal />
          <Footer />
        </div>
      </Router>
    );
  }
}

export default App;
